.storelocator-btn-primary, .storelocator-btn-primary:active, .storelocator-btn-primary:visited, .storelocator-btn-primary:focus { color: #333333 !important; border-color: #cccccc !important; border-radius: 0px !important; background-color: #ffffff !important; filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ffffff', endColorstr='#ffffff') !important; background-image: -khtml-gradient(linear, left top, left bottom, from(#ffffff), to(#ffffff)) !important; background-image: -moz-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -ms-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -webkit-gradient(linear, left top, left bottom, color-stop(0%, #ffffff), color-stop(100%, #ffffff)) !important; background-image: -webkit-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -o-linear-gradient(top, #ffffff, #ffffff) !important; background-image: linear-gradient(#ffffff, #ffffff) !important; }.storelocator-btn-primary:hover { color: #000000 !important; background-color: #e0e0e0 !important; *background-color: #e0e0e0 !important; background-image: none !important; } .storelocator-btn-primary:focus {background-position: 0px 0px; }.storelocator-btn-danger, .storelocator-btn-danger:active, .storelocator-btn-danger:visited, .storelocator-btn-danger:focus { color: #333333 !important; border-color: #cccccc !important; border-radius: 0px !important; background-color: #ffffff !important; filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ffffff', endColorstr='#ffffff') !important; background-image: -khtml-gradient(linear, left top, left bottom, from(#ffffff), to(#ffffff)) !important; background-image: -moz-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -ms-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -webkit-gradient(linear, left top, left bottom, color-stop(0%, #ffffff), color-stop(100%, #ffffff)) !important; background-image: -webkit-linear-gradient(top, #ffffff, #ffffff) !important; background-image: -o-linear-gradient(top, #ffffff, #ffffff) !important; background-image: linear-gradient(#ffffff, #ffffff) !important; }.storelocator-btn-danger:hover { color: #000000 !important; background-color: #e0e0e0 !important; *background-color: #e0e0e0 !important; background-image: none !important; } .storelocator-btn-danger:focus {background-position: 0px 0px; }#storelocatorwidget { font-family: "Helvetica Neue",Helvetica,Arial,sans-serif; font-size: 14px; }
